import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { FrontClienteService } from 'src/app/services/front-cliente.service';
import { Cliente } from 'src/app/model/cliente';

@Component({
  selector: 'app-consultar-cliente',
  templateUrl: './consultar-cliente.component.html',
  styleUrls: ['./consultar-cliente.component.css']
})
export class ConsultarClienteComponent implements OnInit {

  idCliente!: number;
  cliente!: Cliente;

  constructor(
    private clienteService: FrontClienteService,
    private router: Router,
    private route: ActivatedRoute
  ) { }

  ngOnInit(): void {
    this.idCliente = this.route.snapshot.params['id'];
    this.cliente = new Cliente();
    this.clienteService.consultarCliente(this.idCliente).subscribe(data => {
      this.cliente = data;
    });
  }

  retornar() {
    this.router.navigate(['/cliente/listar-cliente']);
  }

}
<div class="container mt-4 scrollable-content" style="height: 80vh; overflow-y: auto;">
        <head>
            <meta charset="UTF-8">
            <meta name="viewport" content="width=device-width, initial-scale=1.0">
            <title>Detalhes do Cliente</title>
            <link rel="stylesheet" href="consultar-cliente.component.css">
        </head>

        <h3>Detalhes do Cliente</h3>
        <br>
        <div><label><b>Nome:</b></label> {{ cliente.nome }}</div>
        <div><label><b>RG:</b></label> {{ cliente.rg }}</div>
        <div><label><b>Orgão Emissor:</b></label> {{ cliente.orgEmissor }}</div>
        <div><label><b>Data de Emissão:</b></label> {{ cliente.dtEmissao |  date:'dd/MM/yyyy' }}</div>
        <div><label><b>CPF/CNPJ:</b></label> {{ cliente.cpfcnpj }}</div>
        <div><label><b>Nacionalidade:</b></label> {{ cliente.nacionalidade }}</div>
        <div><label><b>Naturalidade:</b></label> {{ cliente.naturalidade }}</div>
        <div><label><b>Data de Nascimento:</b></label> {{ cliente.dataNasc |  date:'dd/MM/yyyy' }}</div>
        <div><label><b>Telefone:</b></label> {{ cliente.telefone }}</div>
        <div><label><b>Celular:</b></label> {{ cliente.celular }}</div>
        <div><label><b>Email:</b></label> {{ cliente.email }}</div>
        <br>
        <label>
            <h4>Endereço</h4>
        </label>
        <br>
        <div><label><b>CEP:</b></label> {{ cliente.cep }}</div>
        <div><label><b>Logradouro:</b></label> {{ cliente.logradouro }}</div>
        <div><label><b>Número:</b></label> {{ cliente.numero }}</div>
        <div><label><b>Complemento:</b></label> {{ cliente.complemento }}</div>
        <div><label><b>Bairro:</b></label> {{ cliente.bairro }}</div>
        <div><label><b>Cidade:</b></label> {{ cliente.cidade }}</div>
        <div><label><b>UF (Estado):</b></label> {{ cliente.uf }}</div>
        <br><br>
    
    <div>
        <button (click)="retornar()" class="btn btn-success" style="margin-left: 10px;">Voltar</button>
    </div>
</div>
